import React from "react";

const loginLeftSideBar = () => {
  return (
    <div>
      <div>
        <label style={{ color: "#BF5239" }}>Platfarm</label>
      </div>
      <div>
        <label
          style={{
            color: "#878787",
            fontSize: "25px",
            fontWeight: "400",
            marginTop: "296px",
          }}
        >
          Welcome,
        </label>
      </div>
      <div>
        <label
          style={{
            color: "#3C3C3C",
            fontSize: "25px",
            fontWeight: "700",
            fontWeight: "700",
          }}
        >
          Login to Continue
        </label>
      </div>
      <div>
        <input
          placeholder="Username or phone number"
          style={{
            backgroundColor: "#F0EAE4",
            borderRadius: "10px",
            border: "0px",
            width: "75%",
            height: "30%",
          }}
        ></input>
      </div>
      <div>
        <input placeholder="Password"></input>
      </div>
      <div>
        <button
          style={{
            backgroundColor: "#547445",
            borderRadius: "6px",
            border: "0px",
          }}
        >
          Login
        </button>
      </div>
      <div>
        <label style={{ color: "#BF5239", fontSize: "15px" }}>
          Don't have an account?
        </label>
      </div>
    </div>
  );
};

export default loginLeftSideBar;
